#include <stdio.h>
#include <string.h>

#define MAXN 110
#define MAXM 10

int n, m;
char s[MAXN][MAXM], t[MAXN][MAXM];
int cnts[MAXN], cntt[MAXN];

int main() {
    int i, j, k, l, ans = 0;
    scanf("%d", &n);
    for (i = 0; i < n; i++) {
        scanf("%s", s[i]);
        for (j = 0; j < n; j++) {
            if (strcmp(s[i], s[j]) == 0 && i != j) {
                cnts[i]++;
            }
        }
    }
    scanf("%d", &m);
    for (i = 0; i < m; i++) {
        scanf("%s", t[i]);
        for (j = 0; j < m; j++) {
            if (strcmp(t[i], t[j]) == 0 && i != j) {
                cntt[i]++;
            }
        }
    }
    for (i = 0; i < n; i++) {
        ans = ans + cnts[i] - cntt[i];
        if (ans < 0) {
            break;
        }
    }
    printf("%d\n", ans);
    return 0;
}
